// HasRefundProducts applies the HasEdge predicate on the "refund_products" edge.
func HasRefundProducts() predicate.RefundOrder {
	return predicate.RefundOrder(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, RefundProductsTable, RefundProductsColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasRefundProductsWith applies the HasEdge predicate on the "refund_products" edge with a given conditions (other predicates).
func HasRefundProductsWith(preds ...predicate.RefundOrderProduct) predicate.RefundOrder {
	return predicate.RefundOrder(func(s *sql.Selector) {
		step := newRefundProductsStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.RefundOrder) predicate.RefundOrder {
	return predicate.RefundOrder(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.RefundOrder) predicate.RefundOrder {
	return predicate.RefundOrder(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.RefundOrder) predicate.RefundOrder {
	return predicate.RefundOrder(sql.NotPredicates(p))
}
